import image1 from "../assets/images/image_mel.png";

export default function MeloVibePage() {
  return (
    <>
      <div className="pl-10">
        {/* Title */}
        <div className="text-primary-color text-2xl mt-4 font-bold">
          <span className="text-primary-text-color">Melo</span>
          <span className>Vibe</span>
        </div>

        {/* Body */}

        <div className="flex justify-between h-screen items-center">
          <div className="text-primary-text-color flex flex-col">
            {/* Header */}
            <span className="text-6xl">Discover</span>
            <span className="font-bold text-6xl">your MeloVibe</span>

            {/* Paragraph */}
            <p>
              Let MeloVibe guide your mood with personalized playlists curated
              just for you. <br /> Explore music that matches your vibe
              effortlessly.
            </p>

            {/* Button to go to the mood page */}
          </div>

          {/* Image and circle */}
          <div className="flex">
            <div className="bg-primary-color border w-150 h-150 mr-auto rounded-full">
              <img
                src={image1}
                alt="landingPage"
                className="w-100 h-150 rounded-bl-full rounded-br-full"
              />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
